import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "sys-cancel";
const pathData = "M256.5 0c140 0 255 115 255 256 0 140-115 255-255 255-141 0-256-115-256-255 0-141 115-256 256-256zm0 460c112 0 204-92 204-204 0-113-92-205-204-205-113 0-205 92-205 205 0 112 92 204 205 204zm35-204l59 58c10 11 10 26 0 36s-25 10-36 0l-58-59-59 59c-10 10-26 10-36 0s-10-25 0-36l59-58-59-59c-10-10-10-26 0-36s26-10 36 0l59 59 58-59c11-10 26-10 36 0s10 26 0 36z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
